import React, { useState, useEffect } from 'react';

import Stack from '@mui/material/Stack';

import Card from '../components/card';
import FormGroup from '../components/form-group';

import { mensagemSucesso, mensagemErro } from '../components/toastr';

import '../custom.css';

import axios from 'axios';
import { BASE_URL } from '../config/axios';
import { useParams, useNavigate } from 'react-router-dom';


function CadastroPedido() {
  const { idParam } = useParams();

  const navigate = useNavigate();

  const baseURL = `${BASE_URL}/pedidos`;

  const [id, setId] = useState('');
  const [cliente, setCliente] = useState('');
  const [produtos, setProdutos] = useState([]);
  const [status, setStatus] = useState('');

  const [dados, setDados] = useState([]);

  function inicializar() {
    if (idParam == null) {
      setId('');
      setCliente('');
      setProdutos([]);
      setStatus('');
    } else {
      setId(dados.id);
      setCliente(dados.cliente);
      setProdutos(dados.produtos);
      setStatus(dados.status);
    }
  }

  async function salvar() {
    let data = { id, cliente, produtos, status };
    data = JSON.stringify(data);
    if (idParam == null) {
      await axios
        .post(baseURL, data, {
          headers: { 'Content-Type': 'application/json' },
        })
        .then(function (response) {
          mensagemSucesso(`Pedido ${id} cadastrado com sucesso!`);
          navigate(`/listagem-pedidos`);
        })
        .catch(function (error) {
          mensagemErro(error.response.data);
        });
    } else {
      await axios
        .put(`${baseURL}/${idParam}`, data, {
          headers: { 'Content-Type': 'application/json' },
        })
        .then(function (response) {
          mensagemSucesso(`Pedido ${id} alterado com sucesso!`);
          navigate(`/listagem-pedidos`);
        })
        .catch(function (error) {
          mensagemErro(error.response.data);
        });
    }
  }

  async function buscar() {
    await axios.get(`${baseURL}/${idParam}`).then((response) => {
      setDados(response.data);
    });
    setId(dados.id);
    setCliente(dados.cliente);
    setProdutos(dados.produtos);
    setStatus(dados.status);
  }

  const [dadosPedidos, setDadosPedidos] = useState(null);

  useEffect(() => {
    axios.get(`${BASE_URL}/cursos`).then((response) => {
      setDadosPedidos(response.data);
    });
  }, []);

  useEffect(() => {
    buscar();
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [id]);

  if (!dados) return null;

  return (
    <div className='container'>
      <Card title='Cadastro de Pedido'>
        <div className='row'>
          <div className='col-lg-12'>
            <div className='bs-component'>
              <FormGroup label='Cliente: *' htmlFor='inputCliente'>
                <input
                  type='text'
                  id='inputCliente'
                  value={cliente}
                  className='form-control'
                  name='idCliente'
                  onChange={(e) => setCliente(e.target.value)}
                />
              </FormGroup>
              <FormGroup>
                <label htmlFor='selectProduto'>Produto:</label>
                <select
                  id='selectProduto'
                  value={produtos}
                  onChange={(e) => setProdutos(e.target.value)}
                  className='form-control'
                >
                  <option value=''>Selecione um produto</option>
                  {dadosPedidos.map((produto) => (
                    <option key={produto.id} value={produto.id}>
                      {produto.nome}
                    </option>
                  ))}
                </select>
              </FormGroup>
              <FormGroup>
                <label htmlFor='selectStatus'>Status do Pedido:</label>
                <select
                  id='selectStatus'
                  value={status}
                  onChange={(e) => setStatus(e.target.value)}
                  className='form-control'
                >
                  <option value=''>Selecione um status</option>
                  <option value='pendente'>Pendente</option>
                  <option value='em_andamento'>Em andamento</option>
                  <option value='concluido'>Conclu√≠do</option>
                  <option value='cancelado'>Cancelado</option>
                </select>
              </FormGroup>
              <Stack spacing={1} padding={1} direction='row'>
                <button
                  onClick={salvar}
                  type='button'
                  className='btn btn-success'
                >
                  Salvar
                </button>
                <button
                  onClick={inicializar}
                  type='button'
                  className='btn btn-danger'
                >
                  Cancelar
                </button>
              </Stack>
            </div>
          </div>
        </div>
      </Card>
    </div>
  );
}

export default CadastroPedido;
